INSERT INTO `external_areas` (`id`, `name`, `preface`, `introduction`, `position`, `way`, `open`) VALUES
(1,	'草悟道',	'從國立自然科學博物館、勤美誠品綠園道，至市民廣場，如行草般的行雲流水，發現生活感動；從藝文空間、國立臺灣美術館，到特色美食，如悟道般的樂活心靈，體會都市脈動；在草悟道，悠遊於綠藝之間，看見一座城市的兩種態度。',	'草悟道，北起國立自然科學博物館、南至美術園道綠園道帶狀的都市空間架構，以及沿線的國立自然科學博物館、市民廣場、勤美誠品綠園道、藝文空間、國立臺灣美術館、美食街等活動結點，時而緊湊、時而靜謐的活動強度、氛圍與空間尺度，有濃有淡、有密有疏，如同書法裡「行草」般自然流暢的氣韻。',	'西區英才路534號',	'國美館右側，的碑林綠色步道直走',	''),
(2,	'審計新村',	'',	'原為臺灣省政府審計處（今監察院審計部教育農林審計處）與新聞處（今行政院新聞傳播處地方新聞科）的宿舍，1969年興建完成，是中部繼光復新村、長安新村之後的第三批台灣省政府宿舍群。\\r\\n1998年精省後成為閒置空間逐漸荒廢，審計新村與一般眷村或政府宿舍不同之處在於二層樓的矮建築，牆身的顏色是溫柔的鵝黃色，內部格局小而精緻，為戰後相當有特色的公共建設。近年配合臺中市政府〈摘星青年、築夢台中〉計劃重新規劃轉型成為創業基地與文創園區。',	'西區民生路368巷',	'國美館左側，北朝美村路一段再走民生路',	''),
(3,	'忠信市場',	'忠信市場從一個老市場，變成一個藝文工作者的展演場所，展現出現代與復古的衝突美感。看起來老舊的建築，裡頭卻注入了新的元素。來到這裡會發現，這裡的建築空間都比較小，當初為了節省空間，讓空間更有效的應用，所以每一間房子，坪數其實都不大。忠信市場，一個舊有的空間，曾經是傳統市場，當初熱鬧的景象已不復見，已搖身一變，轉變為新的藝文空間。',	'忠信市場漸漸演變成藝術空間，這裡都是藝文工作者保留舊有的房厝建築結構，再重新設計規劃的藝文空間。忠信市場可供遊客參觀，影像創作播放空間裡頭還有二手書籍和有機產品的販售。 忠信市場企圖提倡一種生活美學及慢活的態度，或者做為一個自我的實踐領域，也讓新一代的藝術工作者可以交流的場地。逐漸地，忠信市場慢慢成為新一代藝術工作者或是對美非常有鑑賞的遊客們，都可以來這裡挖到許多寶物。',	'西區五權西路一段67號',	'國美館對面，長青登山協會招牌巷子進去',	''),
(4,	'英才路470巷',	'',	'結合微地形變化的設計手法，將水韶廣場、茵之下廣場、閱讀森林、市民廣場，整合為感受品味生活與藝文氛圍的交錯綠萌，讓創意繽紛的空間，沁透自然流露的人文風景，只要漫步其中，就能呼應周邊精品店、畫廊與藝廊的文化氣息。',	'',	'',	''),
(5,	'公正路',	'',	'感受潔淨的生態綠意空間，和黑板樹牆與豐富的植生共同呼吸，並將生態設計的水資源循環再利用。地景結合薩璨如、吳靖文、李一村、林慶祥、洪志成、周義雄、林文德、林良材、徐富騰、張清淵等國內外藝術家作品，讓民眾在臺灣即可見到國際藝術與中國書法的完美結合。',	'',	'',	''),
(6,	'向上北路',	'',	'坐落於草悟道的大型裝置藝術─阿薩斯雕像，是美商暴雪娛樂公司Blizzard Entertainment於亞洲唯一的青銅雕像，由好萊塢知名台裔藝術家Steve Wang所帶領的30人團隊，耗時上千小時（逾9個月）完成。台中市地處台灣中部，擁有交通便捷優勢，近年更蓬勃發展國際觀光；阿薩斯雕像落腳於草悟道及美術館區域的人文藝術氛圍，更為此區創造連貫性藝文社區形象與獨一無二的文化地標。',	'',	'',	''),
(7,	'旅禾泡芙之家',	'',	'堅持使用純天然原料，不加工、不添加防腐劑、100%自然風味讓您安心做一個浪漫的甜點旅人，來打開一場與泡芙的美味之旅吧!',	'西區民生路358號',	'',	'11:00–19:00周一至周日'),
(8,	'魚刺人雞蛋糕',	'',	'讓人摸不著頭緒的品牌名稱「魚刺人」來自創辦人的家鄉——南投魚池鄉，巫玠茗與陳榕創立品牌的動機就是來自在家鄉的童年回憶。為打造記憶裡那簡單卻令人念念不忘的滋味，兩人先從食材下手，堅持使用高品質原料，像是保有輕甜蔗香的蔗糖、契作小農的無毒雞蛋、台南鮮醇濃厚的禾香牛奶，搭配親自研發的麵粉配方，堅持每天現做，沒有食品添加物，呈現食材最原始完美的味道。',	'西區民生路352號',	'',	''),
(9,	'艸水木堂',	'',	'主要是販售panini sandwich. & Burger套餐類型，店內主題以旋轉木馬為概念，點餐後可入內拍照等待餐點，因空間不大，所以會限制入店人數。',	'西區民生路364號',	'',	'11:00–19:00周一至周日'),
(10,	'甜月亮義大利手作冰淇淋',	'',	'甜月亮Dolce Luna取自於義大利語，即是「甜月亮」的意思。甜月亮每天提供12種義大冰淇淋口味，每次點餐固定為兩球$120元，可以選杯裝或是甜筒裝。有些口味會隨著當季水果變換，所以每次來的口味都有可能是稍稍不同。',	'西區民生路368巷4弄14號',	'',	'10:00–20:00周一至周日'),
(11,	'成真咖啡ComeTrueCoffee',	'',	'一杯咖啡．一篇嶄新的故事 創辦人王國雄第二次創業，決定以回饋社會與公益為公司經營目的，藉由社會企業：用商業模式來解決社會或環境問題的組織，創造一個新形態的公益平台。 成真社會企業將獲利的50%捐助「非洲潔淨水計畫」，在非洲當地興建水井並進行衛生宣導工作。 透過台灣世界展望會協助，2017年10月於尚比亞楊格村鑿成第一口水井；2018年10月於非洲尚比亞鑿成兩口井；2019年10月於莫三比克鑿成兩口井、馬拉威一口井，目前共計六口井。',	'西區民生路370號',	'',	'10:00–21:00周一至周五；09:00-22:00周六、日'),
(12,	'三時福利社（三時杏仁）',	'',	'三時茶坊入境隨俗，貼合審計新村懷舊風格，取名為三時福利社杏仁茶專賣店，刻意保留紅磚瓦舍外觀，低矮石灰牆以早期閱讀順序寫下審計三時為您服務，一台鏽蝕腳踏車和三輪餐車，營造出古樸柑仔店的意象，喚起六七年級生兒時的回憶。',	'西區民生路356號',	'',	'11:00–18:30周一至周日'),
(13,	'HWC黑沃咖啡',	'',	'「HWC黑沃咖啡」是2016年由一位杯測師、一位尋豆師與五位烘豆師所共同成立的精品咖啡品牌，他們家除了有義式咖啡、手沖咖啡之外，還有多種茶飲、奶茶等，其中最厲害的就是他們家的「黑糖黑玉拿鐵」，不僅榮獲2019台中珍奶節的雙冠王，而且視覺、味蕾通通都能一次滿足。',	'',	'',	'11:00–18:00周一至周日'),
(14,	'繞輪司LAWRENCE',	'',	'如果你問義大利人舌尖上的靈魂是什麼，十個有九個會回答Parmigiano帕瑪森起司是肌肉，也是血液。以最原始的義大利長米、杜蘭小麥、農場雞蛋為基底，剛剛好米心帶點硬，現做現煮手作義。',	'西區民生路368巷1弄3號',	'',	'11:00–20:00周一至周日'),
(15,	'Toku Toku-matcha & coffee',	'',	'是由台灣女孩和日本女孩共創的一間抹茶咖啡館，就在勤美誠品附近的老宅裡。 自日本室內設計系畢業的老闆親手改造60年歲月的老屋，榻榻米、日式庭院，揉合老家具，以及各處的小巧思，讓人彷彿置身京都流咖啡館。 特選來自京都「茶道級」的抹茶粉製作，這裡的抹茶都是老闆特地到日本空運回來台灣，抹茶控們可不能錯過！除此之外，店內也販售各式各樣的和風手作小點心，每一口都是幸福的滋味！',	'中興四巷13號',	'',	'13:00~20:00（週四公休）'),
(16,	'春丸餐包製作所',	'',	'位在五權西街的小巷內，不起眼的店面裡卻是近期台中西區超熱門的餐包專賣店！看似平凡的餐包，竟然多達三十多種口味，每日販售的品項不定，從熱騰騰的熟食到少女最愛的甜點口味都有，除了外帶之外，也能選擇在老宅裡內用，享受一個不一樣的餐包午茶！ 一顆一顆圓滾滾的餐包，切開夾入紅通通的草莓，看起來超誘人啊！跟外面賣的餐包可不同，這裡的餐包特別強調以自培小麥種酵母、日本熊本製粉的皇冠麵粉及嚴選天然材料製作，每一口都帶有濃厚的麵包香與奶香！',	'西區昇平街57號',	'',	'平日7:00~17:30；假日7:00~18:00'),
(17,	'感傷唱片行',	'',	'還記得CD尚未普及的年代，人人一台卡帶機的時光嗎？這位愛音樂成癡的老闆，在台中開了全台唯一一家卡帶專賣店，這間感傷唱片行，裡面賣的不是唱片，而是充滿回憶的卡帶，帶人回到80、90年代那段屬於爸媽的青春歲月！ 店內搜羅了各式各樣的音樂作品，其中以張雨生、伍佰的專輯詢問度最高，除了有想得到的那些經典歌手代表作之外，就連最新的流行音樂、電影配樂，有些也會發行卡帶版本，喜歡音樂的朋友非常值得到此來挖寶啊！',	'西區美村路一段564巷12號',	'',	'13:00~21:00');
INSERT INTO `internal_areas` (`id`, `name`, `position`, `introduction`) VALUES
(1,	'兒童繪本區',	'B1',	'「嗚嗡嗡~嗚嗡嗡~國立臺灣美術館『藝想號』飛船即將開航了，還沒有上船的朋友們邁開你的步伐，趕快登船吧！」 親愛的小朋友、大朋友！歡迎來到國立臺灣美術館兒童繪本區，搭乘「藝想號」夢想飛船。是不是迫不及待的想要一探究竟呢？準備好了嗎？看看船艙內的繪本雷達站、話書艙、故事屋、藝想角落…等奇異空間，讓我們一起用想像力作為翅膀、用理想、夢想、幻想、奇想作為推進器，勇闖藝想世界！'),
(2,	'數位藝術方舟',	'B1',	'「7月17日、方舟停在亞拉拉特山（MountAra-rat）上。」──創世紀8：43月25日美術節，我們在國立台灣美術館，造一艘新船。這是一艘屬於未來公民的船，猶如一座自行創造、自行茁壯的身體機器，當它透過科技的當下性，連同諸創作者自身記憶與意像的勾聯，便能持續生產出向未來敞開的豐富景觀。'),
(3,	'下凹庭園',	'B1',	'位於美術館地下一樓，供各位參訪者散心漫步。'),
(4,	'餐廳春水堂',	'B1',	'提供茶飲、茶食、餐點及茶業、茶具。 營業時間：上午11時至晚上10時週一照常營業'),
(5,	'演講廳',	'1F',	'本館演講廳視聽設備完善，可容納約240個座位，不定期舉辦「建構台灣美術系列」「藝術生活化系列」專題演講，邀請專家學者與民眾分享生活美學心得。為落實藝術教育推廣之意旨，配合本館展覽內容，舉辦相關研討會、座談會。'),
(6,	'E亭',	'1F',	'本館為推動數位科技藝術，提升民眾對於科技與藝術之認知與了解，於本館大門入口右邊的橢圓型建築－E亭，建置科技藝術展示平台，以觸控螢幕引介及呈現科技藝術創作內容，使用者可藉由觸控螢幕的操作，了解本館的空間環境、歷史沿革、展覽/美育活動訊息以及數位科技藝術發展等資訊。期藉此平台引介及呈現科技藝術創作內容，創造一個科技與藝術互相交融的環境，以提升民眾對於科技藝術的美學認知，刺激國內技術研發及藝術創意思惟。 開放時間：週二~週日10:00~18:00'),
(7,	'精品店',	'1F',	'國美館精品店除了提供本館出版品、國內外美術圖書、創意藝術紀念品、影音資料等之外，還有以本館典藏品衍生製作的多元精美之文創商品。國美館精品店是一座富有美學意象的博物館商店，提供民眾一個全然不同的購物環境和體驗。'),
(8,	'美術街',	'1F',	'為橫貫一樓各展覽室的公共空間，適合展示雕塑、裝置藝術等類型作品。為引介國際藝術思潮與藝術創作，並展現國內藝術創作與研究成果，本館結合館內研究人員及館外傑出的策展人，每年策劃多樣類型的展覽。展覽可透過專業的導覽解說員，引導民眾從學習與聆賞中得到多元的藝術知識。'),
(9,	'時光天井',	'1F',	'是國美館三個數位藝術展覽空間中最貼近觀眾的一個，每年均推出四檔展覽。'),
(10,	'竹林天井',	'1F',	'館內1樓有一片竹林，參訪者可以透過落地窗觀賞。'),
(11,	'影音藝術廳',	'2F',	'於2007年1月30日起正式對外開放，位於本館美術街2樓（兒童遊戲室旁），可容納約50個座位，每日定期放映「藝術與紀錄影片」，並於週末不定期舉辦映後座談，與民眾分享拍片心得。另為加強宣傳相關訊息，本館主動蒐集觀眾mail資料，以建立更多的觀眾群。'),
(12,	'研習教室',	'2F',	'為促進美術館藝術教育之推廣，此空間及影音設備提供本館舉辦非營利藝術教育推廣活動使用，規劃以小型演講、研習及操作類型課程使用。'),
(13,	'兒童遊戲室',	'2F',	'若說藝術是成人的遊戲，那麼遊戲就是兒童的藝術！ 在這裡孩子是主人、美感體驗是主題。 在這裡父母是夥伴、探索是任務、發現是驚喜，藝術是遊戲，創意是感動。 在這裡「動手」非禁忌、「創作」非神話、「藝術」也不再高不可攀。 在這裡你可以透過動手做（handson）的環境設計，進行扮演、閱讀、說故事、拼圖、數位互動等遊戲，來認識藝術創作的原理與欣賞藝術作品。'),
(14,	'咖啡廳古典玫瑰園',	'2F',	'提供英式下午茶及各類點心。'),
(15,	'資料中心',	'3F',	'國立臺灣美術館（以下簡稱本館）資料中心成立於民國77年，為一美術專門圖書館，收藏美術相關圖書、期刊、電子資料庫、多媒體資料，尤以臺灣美術相關圖書文獻、本館規劃展之相關主題論著及畫冊為收藏重點。自開館以來不斷累積的各項美術圖書資源，藉由精心建構的閱覽空間及資訊平台，提供給對美術知識及學術有興趣的各界人士參考與利用，期望成為臺灣美術研究的資源中心。'),
(16,	'展覽室',	'1F-3F',	'該展覽室展出各式的藝術作品以及創作，歡迎您攜家帶眷來國美館，度過一個充滿藝術氣息的藝文假期。'),
(17,	'碑林廣場',	'館外',	'以「無牆美術館」為主要概念，於1994~1995年完成雕塑碑林園區之大致設置，由美術館建築本體延伸至館外，戶外作品含括了50件書法碑帖及45件異材質雕塑，營造館內外相呼應、對話的整體藝術氛圍。其中，英才路入口的「碑林廣場」因其書法藝術及墨韻風貌，與周遭青綠園林相互輝映，深受國內外觀光遊客青睞，也是附近民眾生活休憩的熱愛景點。除了能沐浴於綠美化的園藝景觀外，呈現臺灣第一代先賢書法家等重要之手澤墨跡及多樣性的表現樣貌、以現代吹沙技術精工鐫刻而成的技藝亦是園區重要特色。');
