INSERT INTO `museum_histories` (`id`, `date`, `end_date`, `text`) VALUES
(1,	'1988-06-26',	NULL,	'館舍落成開館營運。劉欓河擔任首任館長。發行館刊《臺灣美術》季刊及《館訊》月刊。'),
(2,	'1988-06-27',	NULL,	'與法國敦克爾克現代美術館締結為姊妹館。'),
(3,	'1989-04-08',	NULL,	'與哥斯大黎加共和國國立美術館締結為姊妹館。'),
(4,	'1989-07-22',	NULL,	'接辦「臺灣省全省美展」。（自第44屆起至第53屆止）'),
(5,	'1990-01-23',	NULL,	'接辦「中華民國版印年畫徵選活動」。（自第5屆起）'),
(6,	'1994-03-25',	NULL,	'園區碑林廣場落成揭幕。'),
(7,	'1995-10-25',	NULL,	'園區雕塑揭幕。'),
(8,	'1996-01-16',	NULL,	'首任館長劉欓河退休，由黃國漢接任代理館長。'),
(9,	'1997-08-30',	NULL,	'倪再沁接任第二任館長。'),
(10,	'1999-07-01',	NULL,	'臺灣省立美術館改隸更名為現名「國立臺灣美術館」。'),
(11,	'2000-06-18',	'2000-09-24',	'接辦「威尼斯建築雙年展」臺灣館展覽。於義大利威尼斯普里奇歐尼宮舉辦「第7屆威尼斯建築雙年展〈台灣館〉」─「生命城市〈LifeCity〉」'),
(12,	'2000-10-31',	NULL,	'館長倪再沁缷任，由李戊崑接任代理館長。'),
(13,	'2001-08-02',	NULL,	'李戊崑接任第三任館長。'),
(14,	'2002-09-06',	'2002-11-24',	'於義大利威尼斯普里奇歐尼宮舉辦「第8屆威尼斯建築雙年展〈台灣館〉」─「2050願景臺灣：下一出口〈2050VisionTaiwan-NextExit〉」'),
